import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';

import Navi from "./Testing1.js";
import Chinn from "./Testing2.js";

function Main(){
    return(
        <div>
            <Router>
        
                <Routes>
                    <Route path='/' element={<Navi/>}/>
                    <Route path='/Testing2' element={<Chinn/>}/>
                </Routes>

            </Router>
           
        </div>
    )
}
export default  Main;
